import React from "react";
import Tag from "../Atoms/Tag/Tag";
import './BandTile.css'

function BandTile() {
    return(
        <div id="tile-body">
            <div id="artist-img-container">
                <img id='artist-img' src='https://f4.bcbits.com/img/0026935994_10.jpg'></img>
            </div>
            <Tag />
        </div>
    )
}

export default BandTile
